import React from "react";
import "./style.css";

function Card(props) {
    return (
<div role="img" className="cusCard" onClick={() => props.checkGuess(props.id)
    } style="background-image: url({props.image})">
      
        {/* <img className="card-img imgCus" src={props.image} />  */}
      
</div>

);
}

export default Card;
